import React, { Component } from "react";

const Filter = ({ launch_year }) => {
  return (
    <div className="row">
      {launch_year.map((year) => (
        <div className="col-5 p-1">
          <button className="btn btn-primary">{year}</button>
        </div>
      ))}
    </div>
  );
};

export default Filter;
